script: |
  super -f text -I q2350.spq | sort > q2350.out

inputs:
  - name: q2350.spq
    data: |
      SELECT DISTINCT col2 * + 61 + - 48 AS col1 FROM tab2 (FORMAT parquet) WHERE NOT + col0 + + 17 IN ( - col2 + - CAST ( NULL AS REAL ) * col0 );
  - name: tab2

outputs:
  - name: q2350.out
    data: |
